import React, { useState,useEffect } from 'react'
import './PostJob.css'

function PostJob()  {

    const [message,setMessage]=useState();
    useEffect(() => {
      fetch('http://localhost:2000/PostJob')
  .then(response => {
    if (!response.ok) {
      throw new Error('Network response was not ok');
    }
    return response.text();  // Use text() instead of json() to inspect the raw response first
  })
  .then(data => {
    try {
      const jsonData = JSON.parse(data);  // Try parsing the data
      console.log(jsonData);
    } catch (error) {
      console.error("Error parsing JSON:", error);
      console.log("Response:", data);  // Log the raw response for debugging
    }
  })
  .catch(error => {
    console.error('Fetch error:', error);
  });

      }, []);





  return (
    <section className='container-fluid '>
    <div className="form-wraper">
    <div className="header">
      
        <h5>Enter the details of job to post</h5>
    </div>
    <form action='http://localhost:2000/PostJob' method='post'>
   <h2>{message}</h2>
        <div className="row">
            <div className="col-25"><label htmlFor="fname">Job title:</label></div>
            <div className="col-75"> <input type="text" id="Jtitle" name="Jtitle" autoFocus/></div>
        </div>
        <div className="row">
            <div className="col-25"><label htmlFor="lname">Company:</label></div>
            <div className="col-75"><input type="text" id="Company" name="Company"/></div>
        </div>
        <div className="row">
            <div className="col-25"><label htmlFor="lname">Location:</label></div>
            <div className="col-75"><input type="text" id="Location" name="Location"/></div>
        </div>
        <div className="row">
            <div className="col-25"><label htmlFor="lname">Salary:</label></div>
            <div className="col-75"><input type="text" id="Salary" name="Salary"/></div>
        </div>
        <div className="row">
            <div className="col-25"><label htmlFor="lname">Describtion:</label></div>
            <div className="col-75"><input type="text" id="Describtion" name="Describtion"/></div>
        </div>
        
       
            <div className="row">
                <div className="col-75">
                    <div className="btn-container">
                        <input type="submit" value="Submit"/>
                    </div>
                </div>
            </div>

    </form>
</div>
 
    </section>
  )
}

export default PostJob
